import React from "react";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <div>
      <nav style={{ padding: "20px", backgroundColor: "lightblue" }}>
        <Link style={{ marginLeft: "20px" }} to="/">
          Home
        </Link>
        <Link style={{ marginLeft: "20px" }}>About</Link>
        <Link style={{ marginLeft: "20px" }}>Contact</Link>
      </nav>
    </div>
  );
}
export default Navbar;
